import React from 'react'

const Events = () => {

    const myfunction = () => {
        console.log("clicked")
    }

    return (
        <>
            <div style={{backgroundColor:"red"}}>
            <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Sequi illum omnis dolores fuga hic quam est impedit mollitia quos ab officia fugiat, sit quaerat cumque, ipsum dignissimos deleniti! Debitis iste ratione veniam possimus velit aperiam? Saepe libero quas sed quis unde earum, veniam omnis ab ex corporis fugiat officia magni!</p>
                <button onClick={myfunction}>Click Me</button>
            </div>
        </>
    )
}

export default Events
